async function getIcon(name) {
  let new_name;

  if (!(name in EWI_ICONS_MAP)) {
    // try swapping the '_' for a '-'
    new_name = name.replace(/_/gm, `-`);
    if (!(new_name in EWI_ICONS_MAP)) {
      console.log(`Icon "${name}" is not available`);
      return '';
    }else{
      console.log(`Aliased "${name}" with "${new_name}"`);
      return {path: EWI_ICONS_MAP[new_name].path};
    }
  }
  return {path: EWI_ICONS_MAP[name].path};
}
async function getIconList() {
  return Object.entries(EWI_ICONS_MAP).map(([icon, content]) => ({
    name: icon,
    keywords: content.keywords
  }));
}
